import "../style/sidebar.css";

import React from 'react';
import {Link} from 'react-router-dom';
import { useLocation } from 'react-router-dom';

import Container from 'react-bootstrap/Container';

function HighLightChoice(){
    const location = useLocation();
    let loc = location.pathname;
    if (loc === "/") {
        return(
            "highlight"
        );
    }
}

const Navbar = () => (
    <>
        <div id = "border-make"></div>
            <Container id = "nav" className = "side-nav" fluid = {false}>
                <div id="add-padding">
                    <Link className="side-nav-custom" to="/engineering">Engineering</Link>
                    <Link className="side-nav-custom" to="/design" id = {<HighLightChoice/>}>Design</Link>
                </div>
            </Container>
    </>
);

export default Navbar;
